// Add these functions to your existing api.js file

// Why I Fit Services
export const whyIFitService = {
  // Test the backend connection
  testConnection: () => {
    return api.get("/why-i-fit/test");
  },

  // Generate the complete Why I Fit document
  generateDocument: (data) => {
    return api.post("/why-i-fit/generate", data);
  },

  // Get a preview of the parsed content
  previewContent: (data) => {
    return api.post("/why-i-fit/preview", data);
  },
};
